import React, { useEffect, useState } from "react";

const Cart = () => {
  const [a, setA] = useState([]);
  const fetchdata = async () => {
    const data = await fetch("https://fakestoreapi.com/carts ");
    const result = await data.json();
    setA(result);
  };
  useEffect(() => {
    fetchdata();
  }, []);
  useEffect(() => {
    console.log(a);
  }, [a]);

  return (
    <div>
      <h1>Cart List</h1>
      <uL>
        {a.map((item, index) => (
          <li key={index}>{item.userId}</li>
        ))}
      </uL>
    </div>
  );
};

export default Cart;
